#[allow(dead_code)]
fn polymer_reduction_speculative(s: &str) -> usize {
    "abcdefghijklmnopqrstuvwxyz"
        .chars()
        .map(|c| remove_chars(s, c))
        .map(|s| polymer_reduction(&s))
        .min()
        .unwrap()
}

fn polymer_reduction(s: &str) -> usize {
    let mut result = vec![];
    for c in s.chars() {
        result.push(c);
        if result.len() == 1 {
            continue;
        }
        let l = result.len();
        let last = result[l - 2];
        if last.to_ascii_uppercase() == c.to_ascii_uppercase() && last != c {
            result.remove(l - 1);
            result.remove(l - 2);
        }
    }
    result.len()
}

fn remove_chars(s: &str, c: char) -> String {
    let upper = c.to_ascii_uppercase();
    s.chars().filter(|x| *x != c && *x != upper).collect()
}

#[cfg(test)]
mod tests {
    #[test]
    fn test_polymer_reduction() {
        assert_eq!(10, super::polymer_reduction("dabAcCaCBAcCcaDA"));
        let input = "";
        let reduced = super::polymer_reduction(input);
        assert_eq!(10496, reduced);
        let speculative_reduced = super::polymer_reduction_speculative(input);
        assert_eq!(5774, speculative_reduced);
    }
}
